import Step1 from '../pages/step1/Step1'
import Step2 from '../pages/step2/Step2'
import Step3 from '../pages/step3/Step3'
import Step4 from '../pages/step4/Step4'
import Test from '../pages/test/Test'
import TestHook from '../pages/testHook/TestHook'
import DataFetch from '../pages/testHook/DataFetch'
import DataFetchForm from '../pages/testHook/DataFetchForm'

export default [
    {
        path: '/',
        exact: true,
        component: test
    },
    {
        path: '/step2',
        exact: true,
        component: Step2
    },
    {
        path: '/step3',
        exact: true,
        component: Step3
    },
    {
        path: '/step4',
        exact: true,
        component: Step4
    },
    {
        path: '/test',
        exact: true,
        component: Test
    },
    {
        path: '/TestHook',
        exact: true,
        component: TestHook
    },
    {
        path: '/dataFetch',
        exact: true,
        component: DataFetch
    },
    {

        path: '/dataFetchForm',
        exact: true,
        component: DataFetchForm

    }
]
